import React, { useState } from "react";
import { FiArrowLeft, FiEdit3, FiStar } from "react-icons/fi";
import { useNavigate } from 'react-router-dom';

export default function View_Past_Feedback() {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState("given");
  const feedbacks = [
    {
      service: "Origami Basics & Decorative Folding",
      date: "Jan 15, 2025",
      rating: 5,
      text: "Excellent Origami! The teaching was professional and thorough. Highly recommend!",
    },
    {
      service: "Crocheting for Beginners",
      date: "Jan 10, 2025",
      rating: 4,
      text: "Good at teaching beginners. Arrived on time and completed the tutor efficiently.",
    },
    {
      service: "Hand Embroidery Essentials",
      date: "Jan 5, 2025",
      rating: 5,
      text: "Outstanding work! Very knowledgeable Embroidery who explained everything clearly.",
    },
    {
      service: "DIY Scrapbooking Techniques",
      date: "Dec 28, 2024",
      rating: 3,
      text: "Techniques was okay but took longer than expected.",
    },
  ];

  const renderStars = (rating) => {
    return (
      <div className="flex">
        {[...Array(5)].map((_, i) => (
          <span
            key={i}
            className={i < rating ? "text-yellow-500" : "text-gray-300"}
          >
            â˜…
          </span>
        ))}
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-white flex flex-col max-w-sm mx-auto border">
      {/* Header */}
      <div className="flex items-center px-4 py-3 border-b gap-3">
        <button className="text-xl" onClick={() => navigate(-1)}>
          <FiArrowLeft />
        </button>
        <h1 className="font-medium text-lg">Feedback & Ratings</h1>
      </div>

      {/* Feedback Header Section */}
      <div className="p-4 border-b">
        {/* Toggle Tabs */}
        <div className="flex w-full mb-3">
          <button
            onClick={() => setActiveTab("given")}
            className={`flex items-center justify-center gap-1 w-1/2 px-3 py-2 border rounded-l-md ${
              activeTab === "given"
                ? "bg-black text-white"
                : "bg-gray-100 text-gray-600"
            }`}
          >
            <FiEdit3 />
            <span className="text-sm font-medium">Given</span>
          </button>
          <button
            onClick={() => setActiveTab("received")}
            className={`flex items-center justify-center gap-1 w-1/2 px-3 py-2 border rounded-r-md ${
              activeTab === "received"
                ? "bg-black text-white"
                : "bg-gray-100 text-gray-600"
            }`}
          >
            <FiStar />
            <span className="text-sm font-medium">Received</span>
          </button>
        </div>

        {/* Dropdown Filters */}
        <div className="flex justify-between gap-2">
          <select className="w-1/2 border rounded-md px-2 py-2 text-sm">
            <option>All Services</option>
          </select>
          <select className="w-1/2 border rounded-md px-2 py-2 text-sm">
            <option>All Ratings</option>
          </select>
        </div>
      </div>

      {/* Feedback List */}
      <div className="flex-1 p-4 space-y-4 overflow-y-auto">
        {feedbacks.map((feedback, index) => (
          <div key={index} className="bg-gray-50 p-4 rounded-lg shadow">
            <div className="flex justify-between items-center mb-2">
              <span className="font-semibold">{feedback.service}</span>
              <span className="text-xs text-gray-500">{feedback.date}</span>
            </div>
            <div className="flex items-center mb-2">
              {renderStars(feedback.rating)}
            </div>
            <p className="text-gray-700 text-sm">
              {feedback.text}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
}
